        return {
      field109: "重点功能",field219: "<p style=\"line-height: 1.4;\">通过提供快速编码、实时调试、单元测试、简易项目部署等功能，SnapDevelop实现基于.NET Core框架的非可视化C#项目的快速开发。</p>",field230: "搭建项目脚手架",field220: "为C#项目中的服务和控制器的创建提供便捷的脚手架（Scaffold）功能。您可以配置精密的脚手架规则，使用代码优先（Code First）、数据库优先（DB First）、API 优先（API First）或者UI First（界面优先）的方式，基于开源的Entity Framework Core 或者 SnapObjects ORM模型构建服务与控制器。",field231: "快速编码",field221: "为实现快速而准确的C#代码编写提供完善的代码补全功能。SnapDevelop编辑器即时根据当前输入动态列出有效的值、成员、特性或方法；根据键入内容自动过滤、高亮显示最佳匹配项；并且根据当前方法、属性或者泛型参数提供相关的参数信息。",field232: "高效导航和搜索",field222: "高效的导航和代码搜索功能使类型、文件以及成员的查询更轻松。SnapDevelop编辑器能够快速识别被引用的类型，并跳转至该类型的定义或实现进行查看。通过使用正则表达式，代码查找、替换效率得以大大加强。",field235: "data:image/jpeg;base64,",field368: " 快速修复代码",field370: "SnapDevelop可在用户键入问题代码时直接将问题代码高亮着色、为问题提供修复建议、自动将选择的修复方法对代码进行修复。SnapDevelop还提供了一系列有用的代码重构功能，如重命名、提取方法、提取接口等。",field405: "data:image/gif;base64,",field373: "全面调试",field375: " SnapDevelop具备全面的调试功能，如：设置和管理一个或多个断点；步入、跳过和退出代码；运行至游标位置、设置代码监控、检查调用堆栈、管理异常条件以及查看线程。",field391: " 实时调试REST应用程序编程接口（API）",field393: "SnapDevelop内部集成REST API测试器，支持直接执行REST API的HTTP请求，实现对REST API的底层 C#源代码的高效实时调试。",field411: "data:image/jpeg;base64,",field378: "提供可视化测试REST应用程序编程接口（API）",field380: "通过可视化的Web API测试器，不必手动创建UI或编写JSON代码，实现轻松检验、测试并调试REST API。Web API支持API服务模拟、API调用参数数据模拟、API模拟代理等功能，支持身份验证协议，且允许用户以可视的方式添加或捕获Cookie。",field396: "高效单元测试",field398: "SnapDevelop一体化开发环境支持运行 xUnit.net 测试用例、检查测试结果、并定位错误源代码，完成高效单元测试。",field417: "data:image/png;base64,",field383: "轻松部署",field385: "通过SnapDevelop，可轻松将项目部署至各种环境，包括IIS服务器、本地文件夹、本地或远程Docker服务器、以及Kubernetes集群。",field423: "data:image/jpeg;base64,"
    };
      }
    }

